INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7, 0, 0, 0.0, "キャル", 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2015/12/17 15:00:00", 1, 106001, 7001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7, 0, 0, 0.0, "コッコロ", 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2015/12/17 15:00:00", 1, 105901, 7002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7, 0, 0, 0.0, "ペコリーヌ", 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2015/12/17 15:00:00", 1, 105801, 7003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10, 0, 0, 0.0, "ペコリーヌ", 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2015/12/17 15:00:00", 1, 105801, 10001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10, 0, 0, 0.0, "キャル", 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2015/12/17 15:00:00", 1, 106001, 10002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10, 0, 0, 0.0, "コッコロ", 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2015/12/17 15:00:00", 1, 105901, 10003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10, 0, 2104010, 0.0, "シェフィ", 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2015/12/17 15:00:00", 2, 106401, 10004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (12, 0, 0, 0.0, "ペコリーヌ", 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2015/12/17 15:00:00", 1, 105801, 12001, 1, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13, 0, 0, 0.0, "キャル", 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2015/12/17 15:00:00", 1, 106001, 13001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13, 0, 0, 0.0, "コッコロ", 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2015/12/17 15:00:00", 1, 105901, 13002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13, 0, 2104010, 0.0, "シェフィ", 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2015/12/17 15:00:00", 2, 106401, 13003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13, 0, 0, 0.0, "ペコリーヌ", 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2015/12/17 15:00:00", 1, 105801, 13004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14, 0, 0, 0.0, "コッコロ", 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2015/12/17 15:00:00", 1, 105901, 14001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14, 0, 2104010, 0.0, "シェフィ", 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2015/12/17 15:00:00", 2, 106401, 14002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14, 0, 0, 0.0, "ペコリーヌ", 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2015/12/17 15:00:00", 1, 105801, 14003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14, 0, 0, 0.0, "キャル", 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2015/12/17 15:00:00", 1, 106001, 14004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (15, 0, 0, 0.0, "コッコロ", 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2015/12/17 15:00:00", 1, 105901, 15001, 1, 0.0, "2030/12/17 14:59:59", -470.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16, 0, 2104010, 0.0, "シェフィ", 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2015/12/17 15:00:00", 2, 106401, 16001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16, 0, 0, 0.0, "ペコリーヌ", 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2015/12/17 15:00:00", 1, 105801, 16002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16, 0, 0, 0.0, "キャル", 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2015/12/17 15:00:00", 1, 106001, 16003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16, 0, 0, 0.0, "コッコロ", 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2015/12/17 15:00:00", 1, 105901, 16004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (17, 0, 0, 0.0, "コッコロ", 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2015/12/17 15:00:00", 1, 105901, 17002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (25, 0, 0, 0.0, "キャル", 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2015/12/17 15:00:00", 1, 106001, 17004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (25, 0, 0, 0.0, "コッコロ", 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2015/12/17 15:00:00", 1, 105901, 17005, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (25, 0, 2104010, 0.0, "シェフィ", 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2015/12/17 15:00:00", 2, 106401, 17006, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (25, 0, 0, 0.0, "ペコリーヌ", 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2015/12/17 15:00:00", 1, 105801, 17007, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (18, 0, 0, 0.0, "カリン", 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2015/12/17 15:00:00", 1, 190801, 18001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (18, 0, 0, 0.0, "カリン", 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2015/12/17 15:00:00", 1, 190801, 18002, 2, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (19, 0, 0, 0.0, "カリン", 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2015/12/17 15:00:00", 1, 190801, 19001, 3, 0.0, "2030/12/17 14:59:59", -470.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (19, 0, 0, 0.0, "カリン", 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2015/12/17 15:00:00", 1, 190801, 19002, 4, 0.0, "2030/12/17 14:59:59", -470.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (20, 0, 0, 0.0, "カリン", 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2015/12/17 15:00:00", 1, 190801, 20001, 5, 0.0, "2030/12/17 14:59:59", -470.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (20, 0, 0, 0.0, "カリン", 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2015/12/17 15:00:00", 1, 190801, 20002, 6, 0.0, "2030/12/17 14:59:59", -470.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21, 0, 0, 0.0, "キャル", 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2015/12/17 15:00:00", 1, 106001, 21001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21, 0, 0, 0.0, "コッコロ", 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2015/12/17 15:00:00", 1, 105901, 21002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21, 0, 2104010, 0.0, "シェフィ", 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2015/12/17 15:00:00", 2, 106401, 21003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21, 0, 0, 0.0, "ペコリーヌ", 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2015/12/17 15:00:00", 1, 105801, 21004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (22, 0, 0, 0.0, "カリン", 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2015/12/17 15:00:00", 1, 190801, 22001, 1, 0.0, "2030/12/17 14:59:59", -430.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (22, 0, 0, 0.0, "カリン", 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2015/12/17 15:00:00", 1, 190801, 22002, 2, 0.0, "2030/12/17 14:59:59", -430.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (23, 0, 0, 0.0, "カリン", 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2015/12/17 15:00:00", 1, 190801, 23001, 3, 0.0, "2030/12/17 14:59:59", -430.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (23, 0, 0, 0.0, "カリン", 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2015/12/17 15:00:00", 1, 190801, 23002, 4, 0.0, "2030/12/17 14:59:59", -430.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 4.08, "エリコ（バレンタイン）", 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2019/01/31 12:00:00", 1, 109001, 24001, 1, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 5.0, "エリコ（バレンタイン）", 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2019/01/31 12:00:00", 1, 109001, 24002, 2, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 10.11, "エリコ（バレンタイン）", 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2019/01/31 12:00:00", 1, 109001, 24003, 3, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 4.0, "エリコ（バレンタイン）", 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2019/01/31 12:00:00", 1, 109001, 24004, 4, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 6.0, "エリコ（バレンタイン）", 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2019/01/31 12:00:00", 1, 109001, 24005, 5, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "エリコ（バレンタイン）", 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2019/01/31 12:00:00", 1, 109002, 24006, 6, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "エリコ（バレンタイン）", 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2019/01/31 12:00:00", 1, 109002, 24007, 7, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "エリコ（バレンタイン）", 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2019/01/31 12:00:00", 1, 109002, 24008, 8, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "エリコ（バレンタイン）", 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2019/01/31 12:00:00", 1, 109002, 24009, 9, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "エリコ（バレンタイン）", 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2019/01/31 12:00:00", 1, 109002, 24010, 10, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 2.12, "シズル（バレンタイン）", 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2019/01/31 12:00:00", 1, 109101, 24011, 1, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 4.19, "シズル（バレンタイン）", 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2019/01/31 12:00:00", 5, 109101, 24012, 2, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 2.3, "シズル（バレンタイン）", 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2019/01/31 12:00:00", 2, 109101, 24013, 3, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "シズル（バレンタイン）", 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2019/01/31 12:00:00", 1, 109102, 24014, 4, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 5.23, "シズル（バレンタイン）", 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2019/01/31 12:00:00", 5, 109101, 24015, 5, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "シズル（バレンタイン）", 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2019/01/31 12:00:00", 1, 109102, 24016, 6, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 5.01, "シズル（バレンタイン）", 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2019/01/31 12:00:00", 1, 109101, 24017, 7, 8.0, "2030/12/17 14:59:59", -385.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "シズル（バレンタイン）", 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2019/01/31 12:00:00", 1, 109102, 24018, 8, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "シズル（バレンタイン）", 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2019/01/31 12:00:00", 1, 109102, 24019, 9, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24, 10011, 0, 0.0, "シズル（バレンタイン）", 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2019/01/31 12:00:00", 1, 109102, 24020, 10, 0.0, "2030/12/17 14:59:59", 0.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26, 0, 2104010, 0.0, "シェフィ", 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "2015/12/17 15:00:00", 2, 106401, 26001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26, 0, 0, 0.0, "ペコリーヌ", 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2015/12/17 15:00:00", 1, 105801, 26002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26, 0, 0, 0.0, "キャル", 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "2015/12/17 15:00:00", 1, 106001, 26003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26, 0, 0, 0.0, "コッコロ", 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "2015/12/17 15:00:00", 1, 105901, 26004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27, 0, 2104010, 0.0, "シェフィ", 1, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "2015/12/17 15:00:00", 2, 106401, 27001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27, 0, 0, 0.0, "ペコリーヌ", 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "2015/12/17 15:00:00", 1, 105801, 27002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27, 0, 0, 0.0, "キャル", 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "2015/12/17 15:00:00", 1, 106001, 27003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27, 0, 0, 0.0, "コッコロ", 1, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", "2015/12/17 15:00:00", 1, 105901, 27004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (28, 0, 0, 0.0, "カリン", 1, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", "2019/09/24 15:00:00", 1, 190801, 28001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
