INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (29, 0, 0, 0.0, "カリン", 1, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", "2019/09/24 15:00:00", 1, 190801, 29001, 3, 0.0, "2030/12/17 14:59:59", -409.0);
