INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (31, 0, 0, 0.0, "カリン", 1, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", "2019/10/31 12:00:00", 1, 190801, 31001, 7, 0.0, "2030/12/17 14:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (31, 0, 0, 0.0, "カリン", 1, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", "2019/10/31 12:00:00", 1, 190801, 31002, 8, 0.0, "2030/12/17 14:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (32, 0, 0, 0.0, "カリン", 1, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", "2019/12/20 5:00:00", 1, 190801, 32001, 1, 0.0, "2020/01/04 4:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (32, 0, 0, 0.0, "カリン", 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2019/12/20 5:00:00", 1, 190801, 32002, 2, 0.0, "2020/01/04 4:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (33, 0, 0, 0.0, "カリン", 1, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", "2019/12/20 5:00:00", 1, 190801, 33001, 3, 0.0, "2020/01/04 4:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (33, 0, 0, 0.0, "カリン", 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2019/12/20 5:00:00", 1, 190801, 33002, 4, 0.0, "2020/01/04 4:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (34, 0, 0, 0.0, "カリン", 1, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", "2020/01/04 5:00:00", 1, 190801, 34001, 5, 0.0, "2020/01/10 11:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (34, 0, 0, 0.0, "カリン", 1, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", "2020/01/04 5:00:00", 1, 190801, 34002, 6, 0.0, "2020/01/10 11:59:59", -409.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (38, 0, 0, 5.3, "ペコリーヌ", 2, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", "2015/12/17 15:00:00", 1, 105801, 38001, 1, 0.0, "2030/12/17 14:59:59", -458.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (38, 0, 0, 6.5, "ペコリーヌ", 2, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", "2015/12/17 15:00:00", 1, 105801, 38002, 2, 0.0, "2030/12/17 14:59:59", -458.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (39, 0, 0, 0.0, "ペコリーヌ", 3, "", "2020/04/01", 3, 105801, 39005, 0, 9999.0, "2020/04/08 23:59:59", 9999.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (40, 0, 0, 0.0, "カリン", 1, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", "2015/12/17 15:00:00", 1, 190801, 40001, 2, 0.0, "2030/12/17 14:59:59", -430.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (41, 0, 2104010, 0.0, "シェフィ", 1, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", "2015/12/17 15:00:00", 1, 106401, 41001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (41, 0, 0, 0.0, "ペコリーヌ", 1, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", "2015/12/17 15:00:00", 1, 105801, 41002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (41, 0, 0, 0.0, "キャル", 1, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "2015/12/17 15:00:00", 1, 106001, 41003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (41, 0, 0, 0.0, "コッコロ", 1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "2015/12/17 15:00:00", 1, 105901, 41004, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (42, 0, 0, 0.0, "コッコロ", 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "2015/12/17 15:00:00", 1, 105901, 42001, 1, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (42, 0, 2104010, 0.0, "シェフィ", 1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "2015/12/17 15:00:00", 1, 106401, 42002, 1, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (42, 0, 0, 0.0, "ペコリーヌ", 1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "2015/12/17 15:00:00", 1, 105801, 42003, 1, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (42, 0, 0, 0.0, "キャル", 1, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "2015/12/17 15:00:00", 1, 106001, 42004, 1, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43, 0, 0, 0.0, "ペコリーヌ", 1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "2015/12/17 15:00:00", 1, 105801, 43001, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43, 0, 0, 0.0, "コッコロ", 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "2015/12/17 15:00:00", 1, 105901, 43002, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43, 0, 0, 0.0, "キャル", 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2015/12/17 15:00:00", 1, 106001, 43003, 1, 0.0, "2030/12/17 14:59:59", -363.0);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (44, 0, 0, 0.0, "アメス", 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2015/12/17 15:00:00", 1, 123001, 43004, 1, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (44, 0, 0, 0.0, "アメス", 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "2015/12/17 15:00:00", 1, 123001, 43005, 2, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (45, 0, 0, 5.79, "アメス", 2, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "2015/12/17 15:00:00", 1, 123001, 43006, 3, 0.0, "2030/12/17 14:59:59", -416.5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (46, 0, 0, 0.0, "アメス", 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2015/12/17 15:00:00", 1, 123001, 46001, 1, 0.0, "2030/12/17 14:59:59", -371.5);
